
def bubble_sort(items):
    """
    Sort items with a bubble sort.
    """
    working = True
    while working:
        working = False
        for index, item in enumerate(items):
            if index < len(items) - 1:
                next_index = index + 1
                next_item = items[next_index]
                if item > next_item:
                    items[next_index] = item
                    items[index] = next_item
                    working = True
            else:
                break
    return items

def insertion_sort(items):
    """
    Sort items with an insertion sort.
    """
    last = 0
    for index in range(1, len(items)):
        if items[index] < items[last]:
            temp = items[index]
            for sorted_index in reversed(range(0, last + 1)):
                if temp < items[sorted_index]:
                    items[sorted_index + 1] = items[sorted_index]
                    items[sorted_index] = temp
        last += 1
    return items

def selection_sort(items):
    """
    Sort items with a selection sort.
    """
    for index, item in enumerate(items):
        current_smallest = index
        for search_index in range(index + 1, len(items)):
            if items[search_index] < items[current_smallest]:
                current_smallest = search_index
        temp = items[index]
        items[index] = items[current_smallest]
        items[current_smallest] = temp
    return items

def merge_sort(items):
    """
    Sort items with a merge sort.
    """
    if len(items) < 2:
        return items

    result = []
    mid_point = len(items) // 2
    left_half = merge_sort(items[:mid_point])
    right_half = merge_sort(items[mid_point:])

    x = 0
    y = 0

    while x < len(left_half) and y < len(right_half):
        if left_half[x] > right_half[y]:
            result.append(right_half[y])
            y += 1
        else:
            result.append(left_half[x])
            x += 1
    result += left_half[x:]
    result += right_half[y:]
    return result

def _partition(array, lo, hi):
    pivot = array[hi]

    i = lo - 1
    for j in range(lo, hi):
        if array[j] < pivot:
            i += 1
            temp = array[i]
            array[i] = array[j]
            array[j] = temp
    temp = array[i + 1]
    array[i + 1] = array[hi]
    array[hi] = temp
    return i + 1

def _quicksort(array, lo, hi):
    if lo < hi:
        p = _partition(array, lo, hi)
        _quicksort(array, lo, p - 1)
        _quicksort(array, p + 1, hi)
    return array

def quicksort(array):
    """
    Sort items with a bubble sort.
    Implemented using Lomuto partition scheme
    """
    return _quicksort(array, 0, len(array) - 1)


